import * as React from 'react';
import { View, StyleSheet } from 'react-native';

import { List, Divider, Checkbox, Avatar, Switch } from 'react-native-paper';

import ScreenWrapper from '../ScreenWrapper';

const CenteredCheckbox = () => (
  <View style={styles.centered}>
    <Checkbox status="checked" />
  </View>
);

const ListItemExample = () => {
  return (
    <ScreenWrapper>
      <List.Section title="Text-only">
        <List.Item title="Headline" />
        <List.Item title="Headline" description="Supporting text" />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
        />
        <Divider />
        <List.Item title="Headline" right={() => <CenteredCheckbox />} />
        <List.Item
          title="Headline"
          description="Supporting text"
          right={() => <CenteredCheckbox />}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          right={() => <Checkbox status="checked" />}
        />
        <Divider />
      </List.Section>

      <List.Section title="With icon">
        <List.Item
          title="Headline"
          left={(props) => <List.Icon {...props} icon="account-outline" />}
        />
        <List.Item
          title="Headline"
          description="Supporting text"
          left={(props) => <List.Icon {...props} icon="account-outline" />}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          left={(props) => <List.Icon {...props} icon="account-outline" />}
        />
        <Divider />
        <List.Item
          title="Headline"
          left={(props) => <List.Icon {...props} icon="account-outline" />}
          right={() => <CenteredCheckbox />}
        />
        <List.Item
          title="Headline"
          description="Supporting text"
          left={(props) => <List.Icon {...props} icon="account-outline" />}
          right={() => <CenteredCheckbox />}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          left={(props) => <List.Icon {...props} icon="account-outline" />}
          right={() => <Checkbox status="checked" />}
        />
        <Divider />
      </List.Section>

      <List.Section title="With avatar">
        <List.Item
          title="Headline"
          left={(props) => (
            <Avatar.Text style={props.style} label="A" size={40} />
          )}
        />
        <List.Item
          title="Headline"
          description="Supporting text"
          left={(props) => (
            <Avatar.Text style={props.style} label="A" size={40} />
          )}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          left={(props) => (
            <Avatar.Text style={props.style} label="A" size={40} />
          )}
        />
        <Divider />
        <List.Item
          title="Headline"
          left={(props) => (
            <Avatar.Text style={props.style} label="A" size={40} />
          )}
          right={() => <CenteredCheckbox />}
        />
        <List.Item
          title="Headline"
          description="Supporting text"
          left={(props) => (
            <Avatar.Text style={props.style} label="A" size={40} />
          )}
          right={() => <CenteredCheckbox />}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          left={(props) => (
            <Avatar.Text style={props.style} label="A" size={40} />
          )}
          right={() => <Checkbox status="checked" />}
        />
        <Divider />
      </List.Section>

      <List.Section title="With image">
        <List.Item
          title="Headline"
          left={(props) => (
            <List.Image
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
        />
        <List.Item
          title="Headline"
          description="Supporting text"
          left={(props) => (
            <List.Image
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          left={(props) => (
            <List.Image
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
        />
        <Divider />
        <List.Item
          title="Headline"
          left={(props) => (
            <List.Image
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
          right={() => <CenteredCheckbox />}
        />
        <List.Item
          title="Headline"
          description="Supporting text"
          left={(props) => (
            <List.Image
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
          right={() => <CenteredCheckbox />}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          left={(props) => (
            <List.Image
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
          right={() => <Checkbox status="checked" />}
        />
        <Divider />
      </List.Section>

      <List.Section title="With video">
        <List.Item
          title="Headline"
          left={(props) => (
            <List.Image
              variant="video"
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
        />
        <List.Item
          title="Headline"
          description="Supporting text"
          left={(props) => (
            <List.Image
              variant="video"
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          left={(props) => (
            <List.Image
              variant="video"
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
        />
        <Divider />
        <List.Item
          title="Headline"
          left={(props) => (
            <List.Image
              variant="video"
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
          right={() => <CenteredCheckbox />}
        />
        <List.Item
          title="Headline"
          description="Supporting text"
          left={(props) => (
            <List.Image
              variant="video"
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
          right={() => <CenteredCheckbox />}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          left={(props) => (
            <List.Image
              variant="video"
              style={props.style}
              source={require('../../assets/images/strawberries.jpg')}
            />
          )}
          right={() => <Checkbox status="checked" />}
        />
        <Divider />
      </List.Section>

      <List.Section title="With switch">
        <List.Item
          title="Headline"
          right={() => <Switch disabled style={styles.centered} />}
        />
        <List.Item
          title="Headline"
          description="Supporting text"
          right={() => <Switch disabled style={styles.centered} />}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          right={() => <Switch disabled />}
        />
        <Divider />
        <List.Item
          title="Headline"
          left={(props) => <List.Icon {...props} icon="account-outline" />}
          right={() => <Switch disabled style={styles.centered} />}
        />
        <List.Item
          title="Headline"
          description="Supporting text"
          left={(props) => <List.Icon {...props} icon="account-outline" />}
          right={() => <Switch disabled style={styles.centered} />}
        />
        <List.Item
          title="Headline"
          description="Supporting text that is long enough to fill up multiple lines in the item"
          left={(props) => <List.Icon {...props} icon="account-outline" />}
          right={() => <Switch disabled />}
        />
        <Divider />
      </List.Section>
    </ScreenWrapper>
  );
};

const styles = StyleSheet.create({
  centered: {
    alignSelf: 'center',
  },
});

ListItemExample.title = 'List.Item';

export default ListItemExample;
